Ob(){return new A.bG("Digital Help Desk",2,"00","Maui Bennett","A dedicated time to drop in without appointments to see our tech guru about your tech issues or queries.",u.d)},
LZ(){return new A.bG("Carers Club",14,"00","Sharon Packham","A safe space for all carers (current & previous) to gather and share their journey.  Whether it be frustrations, tips or good news stories we're here to listen and support.  There will also be opportunities for Guest Speaker information sessions on relevant topics taking place within the club.","assets/img/timetable/weekly/Carers Club.png")},
