Rc(){return new A.bG("Travel Club",9,"30"," ","Be whisked away in the comfort of your seat at home to destinations & landmarks around the world.  Visit them through the eyes of travellers to see the sights, history, culture & food.  Join us every Tuesdays, Wednesdays or Thursdays.","assets/img/timetable/b2/Travel Club.png")},
Pg(){return new A.bG("Photography Club",14,"00","TBC","Join our vibrant photo-sharing community\u2014perfect for photography lovers of all levels! Share your best shots of the week, explore new techniques, and trade tips with fellow enthusiasts. Each week brings a fresh theme to inspire your creativity and keep your camera clicking. Weekly themes are in the latest Inclusee Newsletter \u2014don\u2019t miss out, check it out and start snapping!","assets/img/timetable/weekly/In2Photography App Tile.png")},
ON(){return new A.bG("Morning Meditation",9,"30"," ",u.U,u.Q)},
MT(){return new A.bG("Discovery Club",12,"00","E2E Staff","Lunch and Learn is getting a new look! We'll run sessions Mondays and Wednesdays at 12pm that explore new topics like seniors living - with new info and helpful tips, positive ageing -  all things to celebrate this phase of life, and strange history - shocking stories of mystery and the macabre.","assets/img/timetable/weekly/Discovery Hub.jpg")},
R1(){return new A.bG("Theatre Club",1,"00","E2E Staff",u.E,"assets/img/timetable/weekly/theatre.png")},
wK(){return new A.bG("Brain Teasers",1,"00","E2E Staff","Check your Brain health with lots of riddles and puzzles to figure out.  This fun and engaging club is for everyone and anyone.",u.C)},
LM(){return new A.bG("Art Therapy",10,"00","E2E Staff","Explore our Online Art Therapy Club, a haven for self-expression! Our unique approach fosters a therapeutic atmosphere, guiding participants through immersive artistic activities. This club offers diverse experiences, from textiles and subconcious art, to recycled materials and acrylic painting. Join this therapeutic journey with just an open mind, letting your creativity unlock emotions and bring solace.",u.C)},
Po(){return new A.bG("Recipe Club",10,"30","E2E Staff","Join in to have a chat and share recipes with fellow participants.","assets/img/timetable/b2/Recipes Club.png")},
