LS(){return new A.bG("Book Club",10,"00","Deidre Oliver","In2Books club Facilitated on a weekly basis.  All participants read their own book then come together in a social environment to discuss what they have read and even share an extract to the group.The Inclusee book club is a place where you can share what you are reading with our connecting community.  Bring along any book of your choosing and share anything you like about the book.","assets/img/timetable/b2/Book Club.png")},
LR(){return new A.bG("Bible Club",3,"30","Nicole Illing","This club allows various denomination religions to come together to study the bible.","assets/img/timetable/b2/Bible Studies Club.png")},
Nh(){return new A.bG("Games Club",3,"00","Vrushali Dongre","Each week a different game will be played and repeated the same week each month.  For months with an extra week (5 weeks) a new game will be trialled.  Games will consist of Bingo, Scategories, jeopardy, wordshake (similar to boggle), crosswords to name a few.","assets/img/timetable/b2/Games Club.png")},
S4(){return new A.bG("Wellness Club",10,"00","Darren Marr","Join our feel-good wellness club\u2014where we chat, laugh, and unwind. Each session ends with a soothing meditation to leave you feeling refreshed and recharged. Come for the conversation, stay for the calm!","assets/img/timetable/b2/Wellness Club.png")},
Qr(){return new A.bG("Singing Club",3,"00","Shirley Lucas","Warm up those vocal chords and sing along to tunes from 50's, 60's, & 70's or any song you would love to sing your heart out to, in the Inclusee online karaoke club.","assets/img/timetable/b2/Singing Club.png")},
Ni(){return new A.bG("Gardening Club",1,"00","Joanne Cody","A space for Garden lovers to come and share their recent garden adventures/projects, tips, tricks and suggestions to gardening issues raised by others.  Be ready to go on a virtual garden tour of a club participant's garden if we are invited to or perhaps view recent garden photos/excursions that someone has been to.  There is also a weekly topic set which we round off our gardening session with.  You can view this list in the latest Inclusee Newsletter. ","assets/img/timetable/b2/Gardening Club.png")},
OO(){return new A.bG("Mens Hour",10,"00","Jason Lockwood","This is a safe space where men can come together on a weekly basis and share experiences with each other, discuss a range of topics and from time to time have guest speakers on various topics in the community.","assets/img/timetable/b2/Mens Hour.png")},
MD(){return new A.bG("Craft Club",2,"00","Robyn Winslow","Join in while working on your projects and have a chat in a comfortable social environment.  Share your progress on your projects, tips and tricks on your craft of choice or gather some advice on a craft issue you may be having.  There is also a weekly topic set which we round off our crafting session with.  You can view this list in the latest Inclusee Newsletter.","assets/img/timetable/b2/Craft Club.png")},
